async def write_log(log_message):
    log_filename = 'data/logs/logfile.log'
    async with asyncio.Lock():
        async with aiofiles.open(log_filename, mode='a') as logfile:
            timestamp = datetime.now().strftime('%Y-%m-%d %H:%M:%S')
            log_entry = f"[{timestamp}] {log_message}\n"
            await logfile.write(log_entry)

async def insert_into_restaurants(connection, restaurants_data):
    print(f"\n\nDATA RESTARAUNT COUNT INSERTED: {len(restaurants_data)}\n\n")
    # print(restaurants_data)
    try:
        async with connection.cursor() as cursor:
            unique_restaurants_data = []  # List for unique records
            for data in restaurants_data:
                link = data[-1]  # Assuming the last element in the tuple is the link
                select_sql = "SELECT link FROM restaraunts WHERE link = %s"
                await cursor.execute(select_sql, (link,))
                existing_link = await cursor.fetchone()
                if not existing_link:  # If no matches, add the record to the list for insertion
                    unique_restaurants_data.append(data)

            # Check for uniqueness of links in unique_restaurants_data
            unique_links = set()
            unique_restaurants_data_no_duplicates = []
            for data in unique_restaurants_data:
                link = data[-1]
                if link not in unique_links:
                    unique_links.add(link)
                    unique_restaurants_data_no_duplicates.append(data)

            if unique_restaurants_data_no_duplicates:  # If there are unique records to insert
                insert_sql = """
                    INSERT INTO restaraunts (
                        `location`, reviews, rating, `name`, email, 
                        pos_in_rate, `number`, prices, food_rating, 
                        service_rating, value_rating, atmosphere_rating, 
                        g_code, city, link
                    ) VALUES (%s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s)
                """
                await cursor.executemany(insert_sql, unique_restaurants_data_no_duplicates)
                
            await write_log(f"[INFO DB] Restaurants unique pool: {len(unique_restaurants_data_no_duplicates)} update pool: {len(restaurants_data)-len(unique_restaurants_data_no_duplicates)}")

            await connection.commit()  # Commit only after all data has been added
    except Exception as e:
        await write_log(f":[ERROR] inserting/restaurants: {e}")

async def insert_into_city(connection, city_data):
    try:
        async with connection.cursor() as cursor:
            insert_values = []  # Создаем список для значений, которые нужно вставить
            for data in city_data:
                G_id, location, link = data
                select_sql = "SELECT link FROM city WHERE link = %s"
                await cursor.execute(select_sql, (link,))
                existing_link = await cursor.fetchone()
                if not existing_link:  # Если нет совпадений, то добавляем данные в список для вставки
                    insert_values.append((G_id, location, link))
            await write_log(f"[INFO DB] City Unique pool {len(insert_values)}")
            if insert_values:  # Проверяем, есть ли данные для вставки
                insert_sql = """
                    INSERT INTO city (G_id, location, link) 
                    VALUES (%s, %s, %s)
                """
                await cursor.executemany(insert_sql, insert_values)  # Выполняем вставку данных с помощью executemany
            await connection.commit()
    except Exception as e:
        await write_log(f"[ERROR] inserting/city: {e}")

def get_result_data(content,url):
    soup = BeautifulSoup(content, 'html.parser')
    result_data = {}
    div_rate = soup.find('div',class_='QSyom f e Q3 _Z')
    reviews = soup.find('span', class_='GPKsO')
    rating = soup.find('span', class_='biGQs _P fiohW uuBRH')
    name = soup.find('h1', class_='biGQs _P egaXP rRtyp')
    other_ratings = div_rate.find_all('svg', class_='UctUV d H0') if div_rate else None
    div_pos_rate = soup.find('div',class_='CsAqy u Ci Ph w')
    div_emails = soup.find_all('div',class_='hpxwy e j')
    email = None
    for div in div_emails:
        test_res = div.find('a')
        if test_res.get('aria-label') == 'Email':
            email = test_res.get('href').replace('mailto:','')
    main_div = soup.find('div',class_='lJSal _T')
    main_spans = main_div.find_all('span',class_='biGQs _P pZUbB hmDzD') if main_div else None
    prices = main_spans[1] if main_spans else None
    pattern = r"g(\d+)-"
        # Поиск совпадений в строке
    matches = re.search(pattern, url)
    g_code = None
    if matches:
        # Извлечение найденной части
        g_code = matches.group(1)
    
    location_elements = soup.find_all('span',class_='ExtaW f Wh')
    location_elements = [element.text for element in location_elements]
    location = ','.join(location_elements)
    number = soup.find_all('a', href=lambda href: href and 'tel' in href)
    food_rating = service_rating = value_rating = atmosphere_rating = None
    pos_in_rate = div_pos_rate.find('span', class_='biGQs _P pZUbB hmDzD') if div_pos_rate else None
    try:
        city = pos_in_rate.text.split(' ')[-1] if len(pos_in_rate.text.split(' ')) > 2 else ''
    except:
        city = None
    if other_ratings:
        if len(other_ratings[1:]) >= 1:
            food_rating = other_ratings[1].text.split(' ') if other_ratings[1] else None
        if len(other_ratings[1:]) >= 2:
            service_rating = other_ratings[2].text.split(' ') if other_ratings[2] else None
        if len(other_ratings[1:]) >= 3:
            value_rating = other_ratings[3].text.split(' ') if other_ratings[3] else None
        if len(other_ratings[1:]) >= 4:
            atmosphere_rating = other_ratings[4].text.split(' ') if other_ratings[4] else None
        
    result_data['location'] = location if location else None
    result_data['reviews'] = reviews.text.replace(' reviews','') if reviews else None
    result_data['rating'] = rating.text if rating else None
    result_data['name'] = name.text if name else None
    result_data['email'] = email if email else None
    result_data['pos_in_rate'] = pos_in_rate.text if pos_in_rate else None
    result_data['number'] = number[0].text if number else None
    result_data['prices'] = prices.text if prices else None
    result_data['food_rating'] = food_rating[0] if food_rating else None
    result_data['service_rating'] = service_rating[0] if service_rating else None
    result_data['value_rating'] = value_rating[0] if value_rating else None
    result_data['g_code'] = g_code if g_code else None
    result_data['atmosphere_rating'] = atmosphere_rating[0] if atmosphere_rating else None
    result_data['city'] = city
    result_data['link'] = url
    
    return result_data

def read_lines_from_file(filename: str) -> list:
    try:
        # Путь к папке "Downloads"
        folder_path = "Downloads"
        # Формируем полный путь к файлу
        filepath = os.path.join(folder_path, filename)

        with open(filepath, mode='r') as f:
            lines = f.readlines()
            return lines
    except FileNotFoundError:
        logger.error(f"Файл '{filename}' не найден.")
        return []
    except Exception as e:
        logger.error(f"Ошибка при чтении файла '{filename}': {e}")
        return []

def get_files() -> list:
    # Путь к папке "Downloads"
    folder_path = "Downloads"

    try:
        # Получаем список файлов в папке
        files = os.listdir(folder_path)

        # Фильтруем файлы, оставляем только те, которые начинаются с "sitemap"
        sitemap_files = [file for file in files if file.startswith("sitemap")]

        # Выводим список файлов
        logger.info(f"Список файлов в папке 'Downloads', начинающихся с 'sitemap': {len(sitemap_files)}")
        return sitemap_files
    except FileNotFoundError:
        logger.error(f"Папка '{folder_path}' не найдена.")
    except PermissionError:
        logger.error(f"Недостаточно прав для доступа к папке '{folder_path}'.")

async def converter_data(link: str, header: dict, payload: dict, proxy: str):
    await asyncio.sleep(random.randint(1,3))
    global results_data
    async with aiohttp.ClientSession(trust_env=False) as session:
        async with session.get(url=link, headers=header, proxy=proxy, timeout=50) as response:
            if response.status == 200:
                if "Please enable JS and disable any ad blocker" not in await response.text():
                    content = await response.text()
                else:
                    content = None
            else:
                content = None
    if content:
        clear_data = get_result_data(content=content, url=link)
        if "restaraunts_data" not in results_data or "city_data" not in results_data:
            results_data["restaraunts_data"] = []
            results_data["city_data"] = []
        if clear_data["location"] is None and clear_data["name"] is None and clear_data["pos_in_rate"] is None:
            await asyncio.sleep(60*60*4)
            return None
        else:
            results_data['restaraunts_data'].append((
                                                clear_data['location'],
                                                clear_data['reviews'],
                                                clear_data['rating'],
                                                clear_data['name'],
                                                clear_data['email'],
                                                clear_data['pos_in_rate'].replace('\xa0','') if clear_data['pos_in_rate'] and '\xa0' in clear_data['pos_in_rate'] else clear_data['pos_in_rate'],
                                                clear_data['number'],
                                                clear_data['prices'],
                                                clear_data['food_rating'],
                                                clear_data['service_rating'],
                                                clear_data['value_rating'],
                                                clear_data['atmosphere_rating'],
                                                clear_data['g_code'],
                                                clear_data['city'],
                                                clear_data['link'] if clear_data['link'] else None
                                                ))
            substring_before_g_code = clear_data['link'].split(clear_data['g_code'])[0]

            # Replace 'Restaurant_Review' with 'Tourism' in the extracted substring
            try:
                city_link = substring_before_g_code.replace('Restaurant_Review', 'Tourism')
            except Exception as e:
                city_link = substring_before_g_code
            city_code = clear_data['g_code']
            results_data['city_data'].append((city_code,clear_data['location'],city_link))
            
            print(f"\rSUCCESS {datetime.now()} i: {len(results_data['restaraunts_data'])} xml: No defined rest: {clear_data['name']}", end='', flush=True)
            # print(len(results_data['restaraunts_data']))
            if len(results_data['restaraunts_data']) == 500:
                batch_counter = await load_batch_counter()
                batch_counter+=500
                await save_batch_counter(batch_counter)
                logger.info(f"starting create pool and connecting to database")
                async with aiomysql.create_pool(host=DB_HOST, user=DB_USER, password=DB_PASS, db=DB_NAME) as pool:
                    async with pool.acquire() as connection:
                        logger.info(f"starting create pool and connecting to database")
                        await insert_into_restaurants(connection, results_data['restaraunts_data'])
                        await insert_into_city(connection, results_data['city_data'])
                    await connection.commit()
                results_data['restaraunts_data'] = []
                results_data['city_data'] = []
    else:
        logger.error(f"Cannot get data from {link} with proxy {proxy}")    

async def process_link(link, header, payload, proxy, semaphore):
    async with semaphore:
        try:
            res = await converter_data(link, header, payload, proxy)
            if res is None:
                await asyncio.sleep(60*60*4)
            await asyncio.sleep(random.randint(1,3))
        except Exception as e:
            logger.error(f"Error processing {link} with proxy {proxy}: {e}")

async def process_links(links, proxy_dict, payload, max_concurrent_tasks=10):
    semaphore = asyncio.Semaphore(max_concurrent_tasks)
    headers_and_proxies = [(proxy_dict[proxy], proxy) for proxy in proxy_dict]
    proxy_cycle = cycle(headers_and_proxies)
    
    tasks = []
    for link in links:
        header, proxy = next(proxy_cycle)
        task = asyncio.create_task(process_link(link, header, payload, proxy, semaphore))
        tasks.append(task)
          # ждем 1 секунду перед запуском следующего запроса

    await asyncio.gather(*tasks)


